social_posts.post_text:
Had an awesome opportunity visiting @projectk9hero !!! Jason and Amanda were so welcoming and I absolutely love the vision they have for the future of Project K9 Hero. 

@projectk9hero has even sponsored one of our Luke AFB retired MWDs to help with his medical bills and cancer treatment.  I can’t thank them enough for what they do for our K9 community.  They are also building kennels to house K9s who do not adapt well to retired life and would have been euthanized after their service.  I was blown away with all the efforts they do for our 4 legged partners. 

Please show them some love and stay tuned for some new swag!! I got spoiled when I visited and will be posting some of their new stuff soon 🐾💪😜! #projectk9hero #policek9 #militaryworkingdogs #saveour4leggedpartners #retiredk9s #charity

